import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  // Define all navbar links
  const links = [
    { name: "Home", path: "/", type: "main" },
    { name: "Cart", path: "/cart", type: "main" },
    { name: "Custom Pizza", path: "/custom-pizza", type: "main" },
    { name: "Login", path: "/login", type: "login" },
    { name: "Register", path: "/register", type: "register" },
  ];

  return (
    <nav className="navbar" style={{ padding: "10px 20px", backgroundColor: "#48a5e3", display: "flex", alignItems: "center" }}>
      {/* Logo */}
      <Link to="/" className="logo" style={{ marginRight: "20px" }}>
        üçï Pizza Delivery
      </Link>

      {/* Navbar links */}
      <div className="nav-links">
        {links.map((link) => (
          <Link
            key={link.name}
            to={link.path}
            className={link.type === "login" || link.type === "register" ? link.type : ""}
          >
            {link.name}
          </Link>
        ))}
      </div>
    </nav>
  );
};

export default Navbar;
